import PercentWizard from "./FieldGenerator/PercentWizard"
import DollarWizard from "./FieldGenerator/DollarWizard"

class Wizards extends React.Component {
    constructor(props){
        super(props);
    }
    render() {
        const percentWizardRender = this.percentWizardCount.map(() =>
            <div>
                <PercentWizard />
            </div>
        )
        const dollarWizardRender = this.dollarWizardCount.map(() =>
            <div>
                <DollarWizard />
            </div>
        )
        return (
            <div>
                <div>
                    {percentWizardRender}
                </div>
                <div>
                    {dollarWizardRender}
                </div>
            </div>
        )
